import { format} from 'date-fns';
const jwtToken = 'your_actual_jwt_token_here';

// Fetch or make a request with the JWT in the headers
fetch('/protected-route', {
  headers: {
    Authorization: `Bearer ${jwtToken}`
  }
})
.then(response => {
  // Handle response
})
.catch(error => {
  // Handle error
});



export default function Post({title,summary,filepath,content,author}) {
  
    return (
        <div className="post">
            <div className="image">
                <img src={
                    'http://localhost:4000/'+filepath
                }></img>
            </div>
            <div className="texts">
                <h2>{title}</h2>
                <p className="info">
                    <a className="author"></a>
                    <time>{format(new Date(), 'MMMM d, yyyy')}</time>
                </p>
                <p className="summary">{summary}</p>
            </div>
        </div>
    );

}
